r($,"aXi","aFa",()=>{var q="\uc720\ud615 8",p="\u203b [59~60] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",o=" \ub77c\uba74\uc740 \ub9db\uc788\uc9c0\ub9cc \uc18c\uae08\uc774 \ub9ce\uc774 \ub4e4\uc5b4 \uc788\uc5b4\uc11c \uac74\uac15\uc5d0 \ub098\uc069\ub2c8\ub2e4. ( \u3260 ) \ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. ( \u3261 ) \uadf8\ub798\ub3c4 \uad6d\ubb3c\uc744 \uba39\uace0 \uc2f6\uc73c\uba74 \uc2a4\ud504\ub97c \uc870\uae08\ub9cc \ub123\uc2b5\ub2c8\ub2e4. ( \u3262 ) \uadf8\ub9ac\uace0 \ub77c\uba74\uc744 \ub053\uc77c \ub54c \uc2a4\ud504\ub97c \ub2a6\uac8c \ub123\ub294 \uac83\ub3c4 \uc18c\uae08\uc744 \ub35c \uba39\ub294 \ub610 \ud558\ub098\uc758 \ubc29\ubc95\uc785\ub2c8\ub2e4. ( \u3263 ) ",n=null,m="\u203b [61~62] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624. ",l=" \uc9c0\uae08\uc740 \ub3d9\uc804\uacfc \uc9c0\ud3d0\ub97c \ubaa8\ub450 \uc0ac\uc6a9\ud569\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \uc804\uc5d0\ub294 \ub3d9\uc804\ub9cc \uc0ac\uc6a9\ud588\uc2b5\ub2c8\ub2e4. \uc885\uc774\ub85c \ub9cc\ub4e0 \uc9c0\ud3d0\ub294 \uc27d\uac8c \ucc22\uc5b4\uc9c0\uace0 \ub354\ub7ec\uc6cc\uc838\uc11c ( \u3260 ) \ubabb\ud569\ub2c8\ub2e4. \uadf8\ub9ac\uace0 \uac00\uc9dc \ub3c8\uc744 \ub9cc\ub4e4\uae30\ub3c4 \uc27d\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \ub3d9\uc804\ubcf4\ub2e4 \uc9c0\ud3d0\ub97c \ub2a6\uac8c \uc0ac\uc6a9\ud55c \uac83\uc785\ub2c8\ub2e4. ",k="\u203b [63~64] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",j="assets/images/356364.png",i="\u203b [65~66] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",h=" \uc2dd\ud61c\ub294 \ud55c\uad6d\uc758 \uc804\ud1b5 \uc74c\ub8cc\uc218\uc785\ub2c8\ub2e4. \ubcf4\ud1b5 \ubaa8\uc784\uc774\ub098 \uc794\uce58\uc5d0\uc11c ( \u3260 ) \uc2dd\ud61c\ub97c \ub9c8\uc2ed\ub2c8\ub2e4. \uc774\uac83\uc740 \uc2dd\ud61c\uac00 \uc18c\ud654\ub97c \ub3c4\uc640\uc8fc\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. \uc2dd\ud61c\ub294 \ub2ec\uace0 \ub9db\uc788\uc5b4\uc11c \ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \uc88b\uc544\ud569\ub2c8\ub2e4. \uc2dc\uc6d0\ud558\uac8c \ub9c8\uc2dc\uba74 \ub354 \uc88b\uc2b5\ub2c8\ub2e4. \uc800\ub294 \uc2dd\ud61c\ub97c \ub9cc\ub4dc\ub294 \ubc29\ubc95\uc774 \uac04\ub2e8\ud574\uc11c \uc790\uc8fc \ub9cc\ub4e4\uc5b4 \uba39\uc2b5\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \ub9cc\ub4dc\ub294 \ub370 \uc2dc\uac04\uc774 \uc624\ub798 \uac78\ub9bd\ub2c8\ub2e4. ",g="\u203b [67~68] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624. ",f=" \ubb38\uc81c\ub97c \ud480\uae30 \uc5b4\ub824\uc6b8 \ub54c\ub294 \ucc45\uc0c1 \uc55e\uc5d0\ub9cc \uc549\uc544 \uc788\uc9c0 \ub9c8\uc2ed\uc2dc\uc624. \uacc4\uc18d \uc549\uc544 \uc788\uc73c\uba74 \uc88b\uc740 \uc0dd\uac01\uc774 ( \u3260 ) \uc54a\uc2b5\ub2c8\ub2e4. \uadf8\ub7f4 \ub54c\ub294 \uc77c\uc5b4\ub098\uc11c \uac77\ub294 \uac83\uc774 \uc88b\uc2b5\ub2c8\ub2e4. \uac78\uc73c\ub824\uace0 \uaf2d \ubc16\uc73c\ub85c ( \u3261 ). \uc9d1 \uc548\ub3c4 \uc88b\uace0 \uc0ac\ubb34\uc2e4 \uc548\ub3c4 \uad1c\ucc2e\uc2b5\ub2c8\ub2e4.",e="\u203b [69~70] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624. ",d=" \uc6b0\ub9ac \uac00\uc871\uc740 ( \u3260 ) \uc801\uc774 \uc5c6\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc800\ub294 \uadf8\ub3d9\uc548 \ud560\uba38\ub2c8\uaed8\uc11c \ub178\ub798\ub97c \uc88b\uc544\ud558\ub294 \uac83\uc744 \ubab0\ub790\uc2b5\ub2c8\ub2e4. \uadf8\ub7f0\ub370 \uc5b4\uc82f\ubc24\uc5d0 \ud560\uba38\ub2c8\uaed8\uc11c \uacf5\uc5f0 \ucd08\ub300\uc7a5\uc744 \uc8fc\uc168\uc2b5\ub2c8\ub2e4. \uadf8 \uacf5\uc5f0\uc5d0\uc11c \ud560\uba38\ub2c8\uac00 \ub178\ub798\ub97c \ud558\uc2e4 \uac83\uc785\ub2c8\ub2e4. \uc6b0\ub9ac \uac00\uc871\uc740 \uacf5\uc5f0\uc5d0 \uac00\ub824\uace0 \ud569\ub2c8\ub2e4. \uac70\uae30\uc5d0\uc11c \ud560\uba38\ub2c8\uc758 \ub178\ub798\ub97c \ucc98\uc74c \ub4e3\uac8c \ub420 \uac83\uc785\ub2c8\ub2e4. ",c="\u2461 \u5bf9\u8bdd\u4e2d\u4ed6\u7684\u5bb6\u4eba\u4ece\u672a\u542c\u8fc7\u5976\u5976\u7684\u6b4c\u3002 \u2462 \u5976\u5976\u5148\u8bf7\u6211\u4eec\u53bb\u770b\u8868\u6f14\u3002 \u2463 \u8fd9\u4e2a\u4eba\u7684\u5bb6\u4eba\u8981\u53bb\u770b\u5976\u5976\u7684\u8868\u6f14\u3002"
return A.b([A.m("\u2461 \u3261","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0643\u064a\u0641\u064a\u0629 \u0623\u0643\u0644 \u0643\u0645\u064a\u0629 \u0623\u0642\u0644 \u0645\u0646 \u0627\u0644\u0645\u0644\u062d \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u0631\u0627\u0645\u064a\u0648\u0646. \u0627\u0644\u0645\u0644\u062d \u0643\u062b\u064a\u0631 \u0641\u064a \u0627\u0644\u0645\u0633\u062d\u0648\u0642 \u0627\u0644\u0630\u064a \u0646\u0635\u0646\u0639 \u0645\u0646\u0647 \u0627\u0644\u0634\u0648\u0631\u0628\u0629.\u0644\u0630\u0644\u0643 \u0641\u064a \u062d\u0627\u0644 \u0627\u0644\u0631\u063a\u0628\u0629 \u0641\u064a \u0623\u0643\u0644 \u0645\u0644\u062d \u0623\u0642\u0644 \u064a\u0641\u0636\u0644 \u0639\u062f\u0645 \u0634\u0631\u0628 \u0627\u0644\u0634\u0648\u0631\u0628\u0629. \u0644\u0630\u0644\u0643 \u064a\u0643\u0648\u0646 \u0627\u0644\u062a\u0631\u062a\u064a\u0628 \u0643\u0627\u0644\u062a\u0627\u0644\u064a\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4\u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4            ","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u5982\u4f55\u5728\u62c9\u9762\u4e2d\u5c11\u5403\u76d0\u3002\u505a\u8089\u6c64\u7684\u6c64\u91cc\u6709\u5f88\u591a\u76d0\u3002\u6240\u4ee5\uff0c\u5982\u679c\u60f3\u5c11\u5403\u76d0\uff0c\u6700\u597d\u4e0d\u8981\u5403\u8089\u6c64\u3002 [\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4.]\u662f\u987a\u5e8f\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u5982\u4f55\u5728\u62c9\u9eb5\u4e2d\u5c11\u5403\u9e7d\u3002\u505a\u8089\u6e6f\u7684\u6e6f\u88e1\u6709\u5f88\u591a\u9e7d\u3002\u6240\u4ee5\uff0c\u5982\u679c\u4f60\u60f3\u5c11\u5403\u9e7d\uff0c\u6700\u597d\u4e0d\u8981\u5403\u8089\u6e6f\u3002 [\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4.]\u662f\u9806\u5e8f\u3002","This text is about how to have less salt in ramen. There is a lot of salt in ramen powder giving ramen soup its flavor. So, it is desirable not to eat ramen in order to have less salt. This is the correct order. [\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4.]"," \u2460 \u3260\n \u2461 \u3261\n \u2462 \u3262\n \u2463 \u3263"," \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4. ",1,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u30e9\u30fc\u30e1\u30f3\u306b\u542b\u307e\u308c\u308b\u98df\u5869\u3092\u306a\u308b\u3079\u304f\u98df\u3079\u306a\u3044\u3088\u3046\u306b\u3059\u308b\u65b9\u6cd5\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u30e9\u30fc\u30e1\u30f3\u306e\u30b9\u30fc\u30d7\u306b\u98df\u5869\u304c\u591a\u304f\u542b\u307e\u308c\u3066\u3044\u307e\u3059\u3002\u3057\u305f\u304c\u3063\u3066\u98df\u5869\u3092\u306a\u308b\u3079\u304f\u98df\u3079\u306a\u3044\u3088\u3046\u306b\u3059\u308b\u306b\u306f\u3001\u30b9\u30fc\u30d7\u3092\u98f2\u307e\u306a\u3044\u65b9\u304c\u826f\u3044\u3067\u3059\u3002[\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4.(\u30e9\u30fc\u30e1\u30f3\u306e\u5869\u5206\u306f\u4e00\u822c\u7684\u306b\u30b9\u30fc\u30d7\u306b\u542b\u307e\u308c\u3066\u3044\u307e\u3059) \u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4.(\u3060\u304b\u3089\u98df\u5869\u3092\u306a\u308b\u3079\u304f\u98df\u3079\u306a\u3044\u3088\u3046\u306b\u3059\u308b\u306b\u306f\u3001\u30b9\u30fc\u30d7\u3092\u98f2\u307e\u306a\u3044\u65b9\u304c\u826f\u3044\u3067\u3059)]\u306e\u9806\u5e8f\u3067\u3059\u3002","\uc774 \uae00\uc740 \ub77c\uba74\uc5d0 \uc788\ub294 \uc18c\uae08\uc744 \uc801\uac8c \uba39\ub294 \ubc29\ubc95\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504\uc5d0 \uc18c\uae08\uc774 \ub9ce\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294\uac8c \uc88b\uc2b5\ub2c8\ub2e4. [\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4.] \uc21c\uc11c\uc785\ub2c8\ub2e4.","Petikan tersebut berbincang tentang cara-cara untuk mengurangkan garam dalam mi segera.Terdapat banyak garam dalam serbuk perisa mi segera. Jadi, kalau tidak ingin makan terlalu banyak garam,lebih baik jangan makan sup mi segera.[\ub77c\uba74\uc758 \uc18c\uae08\uc740 \ubcf4\ud1b5 \uad6d\ubb3c\uc744 \ub9cc\ub4dc\ub294 \uc2a4\ud504 \uc548\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \uadf8\ub798\uc11c \uc18c\uae08\uc744 \uc801\uac8c \uba39\uc73c\ub824\uba74 \ub77c\uba74 \uad6d\ubb3c\uc744 \uba39\uc9c0 \uc54a\ub294 \uac8c \uc88b\uc2b5\ub2c8\ub2e4.] Susunan yang betul.",q,n,"59. \ub2e4\uc74c \ubb38\uc7a5\uc774 \ub4e4\uc5b4\uac08 \uacf3\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",p,o),A.m("\u2462 \uc2a4\ud504\ub97c \uba3c\uc800 \ub123\uc73c\uba74 \uc18c\uae08\uc744 \ub9ce\uc774 \uba39\uac8c \ub429\ub2c8\ub2e4.","1- \u0627\u0644\u0631\u0627\u0645\u064a\u0648\u0646 \u0637\u0639\u0627\u0645 \u0645\u0636\u0631 \u0628\u0627\u0644\u0635\u062d\u0629 2- \u0648\u0636\u0639 \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0645\u0633\u062d\u0648\u0642 \u0627\u0644\u0634\u0648\u0631\u0628\u0629 \u0644\u064a\u0633 \u062c\u064a\u062f \u0644\u0644\u0635\u062d\u0629. 4- \u0647\u0646\u0627\u0643 \u0637\u0631\u0642 \u0639\u062f\u064a\u062f\u0629 \u0644\u0623\u0643\u0644 \u0627\u0644\u0642\u0644\u064a\u0644 \u0645\u0646 \u0627\u0644\u0645\u0644\u062d \u0641\u064a \u0627\u0644\u0631\u0627\u0645\u064a\u0648\u0646","\u2460 \u62c9\u9762\u662f\u4e0d\u5065\u5eb7\u7684\u98df\u54c1\u3002 \u2461\u8c03\u7406\u653e\u592a\u591a\u5bf9\u5065\u5eb7\u4e0d\u5229\u3002 \u2463 \u62c9\u9762\u5c11\u5403\u76d0\u7684\u65b9\u6cd5\u6709\u5f88\u591a\u79cd\u3002","\u2460 \u62c9\u9eb5\u662f\u4e0d\u5065\u5eb7\u7684\u98df\u54c1\u3002 \u2461\u8abf\u7406\u653e\u592a\u591a\u5c0d\u5065\u5eb7\u4e0d\u5229\u3002 \u2463 \u62c9\u9eb5\u5c11\u5403\u9e7d\u7684\u65b9\u6cd5\u6709\u5f88\u591a\u7a2e\u3002","\u2460 Ramen is bad for health. \u2461 Pouring too many ramen powder in ramen is bad for health. \u2463 There are various ways to have less salt."," \u2460 \ub77c\uba74\uc740 \uac74\uac15\uc5d0 \uc88b\uc740 \uc74c\uc2dd\uc785\ub2c8\ub2e4.\n \u2461 \uc2a4\ud504\ub97c \ub9ce\uc774 \ub123\uc73c\uba74 \uac74\uac15\uc5d0 \uc88b\uc2b5\ub2c8\ub2e4.\n \u2462 \uc2a4\ud504\ub97c \uba3c\uc800 \ub123\uc73c\uba74 \uc18c\uae08\uc744 \ub9ce\uc774 \uba39\uac8c \ub429\ub2c8\ub2e4.\n \u2463 \ub77c\uba74\uc758 \uc18c\uae08\uc744 \uc801\uac8c \uba39\ub294 \ubc29\ubc95\uc740 \ud55c \uac00\uc9c0\uc785\ub2c8\ub2e4. ",n,2,"\u2460\u30e9\u30fc\u30e1\u30f3\u306f\u5065\u5eb7\u306b\u60aa\u3044\u98df\u3079\u7269\u3067\u3059\u3002\u2461\u30b9\u30fc\u30d7\u3092\u305f\u304f\u3055\u3093\u5165\u308c\u308b\u3068\u5065\u5eb7\u306b\u60aa\u3044\u3067\u3059\u3002\u2463\u30e9\u30fc\u30e1\u30f3\u306e\u5869\u5206\u3092\u306a\u308b\u3079\u304f\u98df\u3079\u306a\u3044\u65b9\u6cd5\u306f\u3044\u304f\u3064\u304b\u3042\u308a\u307e\u3059\u3002","\u2460 \ub77c\uba74\uc740 \uac74\uac15\uc5d0 \ub098\uc05c \uc74c\uc2dd\uc785\ub2c8\ub2e4. \u2461 \uc2a4\ud504\ub97c \ub9ce\uc774 \ub123\uc73c\uba74 \uac74\uac15\uc5d0 \ub098\uc069\ub2c8\ub2e4. \u2462 \uc2a4\ud504\ub97c \uba3c\uc800 \ub123\uc73c\uba74 \uc18c\uae08\uc744 \ub9ce\uc774 \uba39\uac8c \ub429\ub2c8\ub2e4. \u2463 \ub77c\uba74\uc758 \uc18c\uae08\uc744 \uc801\uac8c \uba39\ub294 \ubc29\ubc95\uc740 \uc5ec\ub7ec \uac00\uc9c0\uc785\ub2c8\ub2e4. ","\u2460 Mi segera tidak baik untuk badan. \u2461 Meletakkan terlalu banyak serbuk perisa tidak baik untuk badan. \u2463 Terdapat pelbagai cara bagaimana mengurangkan pemakanan garam.",q,n,"60. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",p,o),A.m("\u2460 \uc624\ub798 \uc4f0\uc9c0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0633\u0628\u0628 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0639\u0645\u0644\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0628\u0639\u062f \u0627\u0644\u0639\u0645\u0644\u0627\u062a \u0627\u0644\u0645\u0639\u062f\u0646\u064a\u0629.\u0627\u0644\u0639\u0645\u0644\u0627\u062a \u0627\u0644\u0645\u0639\u062f\u0646\u064a\u0629 \u062a\u064f\u0635\u0646\u0639 \u0645\u0646 \u0627\u0644\u0648\u0631\u0642 \u0648\u0644\u0630\u0644\u0643 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u062a\u0645\u0632\u0642 \u0648\u062a\u062a\u0633\u062e. \u0644\u0630\u0644\u0643 \u0644\u0627 \u064a\u0645\u0643\u0646 \u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647\u0627 \u0644\u0648\u0642\u062a \u0637\u0648\u064a\u0644. [\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4= \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4]","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u4e3a\u4ec0\u4e48\u7eb8\u5e01\u6bd4\u786c\u5e01\u66f4\u665a\u4f7f\u7528\u7684\u3002\u949e\u7968\u662f\u7528\u7eb8\u505a\u7684\uff0c\u8fd9\u4f7f\u5f97\u5b83\u4eec\u88ab\u6495\u7834\u548c\u5f04\u810f\u3002\u6240\u4ee5\u4e0d\u80fd\u957f\u671f\u4f7f\u7528\u3002[\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4 = \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4]","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u70ba\u4ec0\u9ebc\u7d19\u5e63\u6bd4\u786c\u5e63\u66f4\u665a\u4f7f\u7528\u7684\u3002\u9214\u7968\u662f\u7528\u7d19\u505a\u7684\uff0c\u9019\u4f7f\u5f97\u5b83\u5011\u88ab\u6495\u7834\u548c\u5f04\u9ad2\u3002\u6240\u4ee5\u4e0d\u80fd\u9577\u671f\u4f7f\u7528\u3002 [\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4 = \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4]","This text is about why the use of paper money was later than coins. Paper money gets torn and dirty because it is made of paper. So, It can't be used for a long time. [\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4 = \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4]"," \u2460 \uc624\ub798 \uc4f0\uc9c0\n \u2461 \uac00\ub054 \ub0b4\uc9c0\n \u2462 \uc790\uc8fc \ub9cc\ub4e4\uc9c0\n \u2463 \uacc4\uc18d \ub098\uc624\uc9c0",n,3,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u7d19\u5e63\u3092\u786c\u8ca8\u3088\u308a\u3082\u9045\u308c\u3066\u4f7f\u7528\u3059\u308b\u3053\u3068\u306b\u306a\u3063\u305f\u7406\u7531\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u7d19\u5e63\u306f\u7d19\u3067\u4f5c\u308b\u306e\u3067\u7834\u308c\u3066\u6c5a\u308c\u307e\u3059\u3002\u3057\u305f\u304c\u3063\u3066\u9577\u304f\u4f7f\u7528\u3067\u304d\u307e\u305b\u3093\u3002[\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4(\u9577\u304f\u4f7f\u7528\u3067\u304d\u307e\u305b\u3093) = \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4(\u9577\u304f\u4f7f\u3048\u307e\u305b\u3093)]","\uc774 \uae00\uc740 \ub3d9\uc804\ubcf4\ub2e4 \uc9c0\ud3d0\ub97c \ub2a6\uac8c \uc0ac\uc6a9\ud558\uac8c \ub41c \uc774\uc720\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc9c0\ud3d0\ub294 \uc885\uc774\ub85c \ub9cc\ub4e4\uc5b4\uc11c \ucc22\uc5b4\uc9c0\uace0 \ub354\ub7ec\uc6cc\uc9d1\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4. [\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4 = \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4]","Petikan tersebut berbincang tentang mengapakah penggunaan duit kertas lebih lambat daripada penggunaan duit syiling. Duit kertas boleh terkoyak atau menjadi kotor keran dibuat daripada kertas. Jadi, duit kertas tidak dapat lama digunakan. [\uc624\ub798 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud569\ub2c8\ub2e4 = \uc624\ub798 \uc4f0\uc9c0 \ubabb\ud569\ub2c8\ub2e4]",q,n,"61. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",m,l),A.m("\u2460 \uc9c0\ud3d0\ub294 \uc798 \ub354\ub7ec\uc6cc\uc9d1\ub2c8\ub2e4.","2- \u0642\u062f\u064a\u0645\u0627 \u0627\u0633\u062a\u062e\u062f\u0645\u062a \u0627\u0644\u0639\u0645\u0644\u0627\u062a \u0627\u0644\u0645\u0639\u062f\u0646\u064a\u0629 \u0641\u0642\u0637. 3- \u0627\u0644\u0639\u0645\u0644\u0627\u062a \u0627\u0644\u0645\u0639\u062f\u0646\u064a\u0629 \u0638\u0647\u0631\u062a \u0642\u0628\u0644 \u0627\u0644\u0648\u0631\u0642\u0629. 4- \u064a\u0645\u0643\u0646 \u062a\u0632\u0648\u064a\u0631 \u0627\u0644\u0639\u0645\u0644\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0628\u0633\u0647\u0648\u0644\u0629","\u2461 \u8fc7\u53bb\u53ea\u4f7f\u7528\u786c\u5e01\u3002 \u2462 \u786c\u5e01\u5148\u4e8e\u949e\u7968\u51fa\u6765\u3002 \u2463 \u7eb8\u5e01\u5bb9\u6613\u9020\u5047\u3002","\u2461 \u904e\u53bb\u53ea\u4f7f\u7528\u786c\u5e63\u3002 \u2462 \u786c\u5e63\u5148\u65bc\u9214\u7968\u51fa\u4f86\u3002 \u2463 \u7d19\u5e63\u5bb9\u6613\u9020\u5047\u3002","\u2461 Only coins were used in former times.  \u2462 The invention of coins was followed by paper money. \u2463 When it comes to paper money, it is easy to print counterfeit money"," \u2460 \uc9c0\ud3d0\ub294 \uc798 \ub354\ub7ec\uc6cc\uc9d1\ub2c8\ub2e4.\n \u2461 \uc61b\ub0a0\uc5d0\ub3c4 \uc9c0\ud3d0\ub97c \uc0ac\uc6a9\ud588\uc2b5\ub2c8\ub2e4. \n \u2462 \uc9c0\ud3d0\uac00 \ub3d9\uc804\ubcf4\ub2e4 \uba3c\uc800 \ub098\uc654\uc2b5\ub2c8\ub2e4. \n \u2463 \ub3d9\uc804\uc740 \uac00\uc9dc \ub3c8\uc744 \ub9cc\ub4e4\uae30 \uc27d\uc2b5\ub2c8\ub2e4. ",n,4,"\u2461\u6614\u306f\u786c\u8ca8\u3060\u3051\u3092\u4f7f\u7528\u3057\u307e\u3057\u305f\u3002\u2462\u786c\u8ca8\u304c\u7d19\u5e63\u3088\u308a\u3082\u5148\u306b\u4f5c\u3089\u308c\u307e\u3057\u305f\u3002\u2463\u7d19\u5e63\u306f\u507d\u672d\u304c\u4f5c\u308a\u3084\u3059\u3044\u3067\u3059\u3002","\u2460 \uc9c0\ud3d0\ub294 \uc798 \ub354\ub7ec\uc6cc\uc9d1\ub2c8\ub2e4. \u2461 \uc61b\ub0a0\uc5d0\ub294 \ub3d9\uc804\ub9cc \uc0ac\uc6a9\ud588\uc2b5\ub2c8\ub2e4. \u2462 \ub3d9\uc804\uc774 \uc9c0\ud3d0\ubcf4\ub2e4 \uba3c\uc800 \ub098\uc654\uc2b5\ub2c8\ub2e4. \u2463 \uc9c0\ud3d0\ub294 \uac00\uc9dc \ub3c8\uc744 \ub9cc\ub4e4\uae30 \uc27d\uc2b5\ub2c8\ub2e4. ","\u2461 Hanya duit syiling diguakan pada masa dahulu. \u2462 Penciptaan duit syiling dikeluarkan lebih cepat daripada duit kertas . \u2463 Duit kertas palsu boleh dibuat dengan senangnya.",q,n,"62. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",m,l),A.m("\u2463 \ub300\ud68c \uc2dc\uac04\uacfc \uc7a5\uc18c\ub97c \uc54c\ub824 \uc8fc\ub824\uace0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u062d\u062f\u062b \u0639\u0646 \u0625\u0631\u0634\u0627\u062f\u0627\u062a \u062a\u064f\u0631\u0633\u0644 \u0644\u0644\u0645\u062a\u0642\u062f\u0645\u064a\u0646 \u0628\u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0641\u064a \u0645\u0628\u0627\u0631\u0627\u0629 \u0643\u0631\u0629 \u0627\u0644\u0633\u0644\u0629.\u062a\u0642\u0648\u0645 \u0627\u0644\u0633\u064a\u062f\u0629 \u0643\u064a\u0645 \u064a\u0648 \u0645\u064a \u0628\u062a\u0642\u062f\u064a\u0645 \u0627\u0644\u0625\u0631\u0634\u0627\u062f\u0627\u062a \u062d\u0648\u0644 \u0645\u0648\u0639\u062f \u062d\u0636\u0648\u0631 \u0627\u0644\u0645\u0628\u0627\u0631\u0627\u0629 \u0648\u0645\u0643\u0627\u0646\u0647\u0627","\u672c\u6587\u662f\u53d1\u9001\u7ed9\u7533\u8bf7\u8005\u53c2\u52a0\u7bee\u7403\u6bd4\u8d5b\u7684\u6307\u5bfc\u90ae\u4ef6\u3002\uae40\uc720\ubbf8\uc528\u6b63\u5728\u50cf\u53c2\u4e0e\u8005\u4ecb\u7ecd\u5230\u8fbe\u65f6\u95f4\u548c\u5730\u70b9\u3002","\u672c\u6587\u662f\u767c\u9001\u7d66\u7533\u8acb\u8005\u53c3\u52a0\u7c43\u7403\u6bd4\u8cfd\u7684\u6307\u5c0e\u90f5\u4ef6\u3002 \uae40\uc720\ubbf8\uc528\u6b63\u5728\u50cf\u53c3\u8207\u8005\u4ecb\u7d39\u5230\u9054\u6642\u9593\u548c\u5730\u9ede\u3002","This text is an email notice sent to applicants for the basketball competition. Yumi Kim informs them of the date and the venue applicants must arrive."," \u2460 \ub300\ud68c \ub0a0\uc9dc\ub97c \ubc14\uafb8\ub824\uace0\n \u2461 \ub300\ud68c \ucc38\uac00 \uc2e0\uccad\uc744 \ubc1b\uc73c\ub824\uace0\n \u2462 \ub300\ud68c \ucc38\uac00 \uc2e0\uccad\uc744 \ucde8\uc18c\ud558\ub824\uace0\n \u2463 \ub300\ud68c \uc2dc\uac04\uacfc \uc7a5\uc18c\ub97c \uc54c\ub824 \uc8fc\ub824\uace0",n,5,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u30d0\u30b9\u30b1\u30c3\u30c8\u30dc\u30fc\u30eb\u5927\u4f1a\u306e\u53c2\u52a0\u7533\u8fbc\u8005\u306b\u9001\u4fe1\u3059\u308b\u6848\u5185\u30e1\u30fc\u30eb\u3067\u3059\u3002\u30ad\u30e0\u30fb\u30e6\u30df\u3055\u3093\u306f\u3001\u53c2\u52a0\u8005\u304c\u6765\u306a\u3051\u308c\u3070\u306a\u3089\u306a\u3044\u6642\u9593\u3068\u5927\u4f1a\u306e\u5834\u6240\u3092\u6848\u5185\u3057\u3066\u3044\u307e\u3059\u3002","\uc774 \uae00\uc740 \ub18d\uad6c \ub300\ud68c \ucc38\uac00 \uc2e0\uccad\uc790\uc5d0\uac8c \ubcf4\ub0b4\ub294 \uc548\ub0b4 \uc774\uba54\uc77c\uc785\ub2c8\ub2e4. \uae40\uc720\ubbf8\uc528\ub294 \ucc38\uac00\uc790\ub4e4\uc774 \uc640\uc57c \ud558\ub294 \uc2dc\uac04\uacfc \ub300\ud68c \uc7a5\uc18c\ub97c \uc548\ub0b4\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang e-mel yang dihantar kepada peyerta pertandingan bola keranjang. Yumi Kim memaklumkan peyerta tentang masa dan tempat berkumpul. ",q,j,"63. \uc720\ubbf8 \uc528\ub294 \uc65c \uc774 \uae00\uc744 \uc37c\uc2b5\ub2c8\uae4c? (2\uc810)",k,n),A.m("\u2463 \ub0a0\uc528\uac00 \uc88b\uc73c\uba74 \uc6b4\ub3d9\uc7a5\uc5d0\uc11c \ub18d\uad6c \ub300\ud68c\ub97c \ud560 \uac81\ub2c8\ub2e4.","1- \u0642\u0627\u0639\u0629 \u0627\u0644\u0631\u064a\u0627\u0636\u0629 \u0645\u0648\u062c\u0648\u062f\u0629 \u0628\u062c\u0627\u0646\u0628 \u0645\u0628\u0646\u0649 \u0627\u0644\u0637\u0644\u0627\u0628. 2- \u0639\u0646\u062f \u062a\u0633\u0627\u0642\u0637 \u0627\u0644\u0627\u0645\u0637\u0627\u0631 \u062a\u0642\u0627\u0645 \u0645\u0628\u0627\u0631\u0627\u0629 \u0643\u0631\u0629 \u0627\u0644\u0633\u0644\u0629 \u0641\u064a \u0642\u0627\u0639\u0629 \u0627\u0644\u0631\u064a\u0627\u0636\u0629. 3- \u0639\u0644\u0649 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u064a\u0646 \u0641\u064a \u0645\u0628\u0627\u0631\u0627\u0629 \u0643\u0631\u0629 \u0627\u0644\u0633\u0644\u0629 \u0627\u0644\u062d\u0636\u0648\u0631 \u062d\u062a\u0649 \u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u062a\u0627\u0633\u0639\u0629","\u2460 \u4f53\u80b2\u9986\u4f4d\u4e8e\u5b66\u751f\u4e2d\u5fc3\u65c1\u8fb9\u3002 \u2461 \u4e0b\u96e8\u7684\u65f6\u5019\uff0c\u5728\u4f53\u80b2\u9986\u91cc\u4e3e\u884c\u7bee\u7403\u8d5b\u3002 \u2462 \u7bee\u7403\u8d5b\u53c2\u8d5b\u8005\u5fc5\u987b\u5728 9 \u70b9\u524d\u5230\u573a\u3002","\u2460 \u9ad4\u80b2\u9928\u4f4d\u65bc\u5b78\u751f\u4e2d\u5fc3\u65c1\u908a\u3002 \u2461 \u4e0b\u96e8\u7684\u6642\u5019\uff0c\u6211\u5011\u5728\u9ad4\u80b2\u9928\u88e1\u8209\u884c\u7c43\u7403\u8cfd\u3002 \u2462 \u7c43\u7403\u8cfd\u53c3\u8cfd\u8005\u5fc5\u9808\u5728 9 \u9ede\u524d\u5230\u5834\u3002","\u2460 The school gym is next to the students union. \u2461 If it rains, the basketball competition will be held in the school gym. \u2462 Participants in the basketball competition must arrive by 9 a.m."," \u2460 \uccb4\uc721\uad00\uc740 \uc6b4\ub3d9\uc7a5 \uc606\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \n \u2461 \ube44\uac00 \uc624\uba74 \ub18d\uad6c \ub300\ud68c\ub97c \ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \n \u2462 \ub18d\uad6c \ub300\ud68c \ucc38\uac00\uc790\ub294 10\uc2dc\uae4c\uc9c0 \uc640\uc57c \ud569\ub2c8\ub2e4. \n \u2463 \ub0a0\uc528\uac00 \uc88b\uc73c\uba74 \uc6b4\ub3d9\uc7a5\uc5d0\uc11c \ub18d\uad6c \ub300\ud68c\ub97c \ud560 \uac81\ub2c8\ub2e4. ",n,6,"\u2460\u4f53\u80b2\u9928\u306f\u5b66\u751f\u4f1a\u9928\u306e\u96a3\u306b\u3042\u308a\u307e\u3059\u3002\u2461\u96e8\u304c\u964d\u308c\u3070\u4f53\u80b2\u9928\u3067\u30d0\u30b9\u30b1\u30c3\u30c8\u30dc\u30fc\u30eb\u5927\u4f1a\u3092\u3057\u307e\u3059\u3002\u2462\u30d0\u30b9\u30b1\u30c3\u30c8\u30dc\u30fc\u30eb\u5927\u4f1a\u53c2\u52a0\u8005\u306f9\u6642\u307e\u3067\u306b\u6765\u306a\u3051\u308c\u3070\u306a\u308a\u307e\u305b\u3093\u3002","\u2460 \uccb4\uc721\uad00\uc740 \ud559\uc0dd\ud68c\uad00 \uc606\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \u2461 \ube44\uac00 \uc624\uba74 \uccb4\uc721\uad00\uc5d0\uc11c \ub18d\uad6c \ub300\ud68c\ub97c \ud569\ub2c8\ub2e4. \u2462 \ub18d\uad6c \ub300\ud68c \ucc38\uac00\uc790\ub294 9\uc2dc\uae4c\uc9c0 \uc640\uc57c \ud569\ub2c8\ub2e4. \u2463 \ub0a0\uc528\uac00 \uc88b\uc73c\uba74 \uc6b4\ub3d9\uc7a5\uc5d0\uc11c \ub18d\uad6c \ub300\ud68c\ub97c \ud560 \uac81\ub2c8\ub2e4. ","\u2460 Kompleks sukan berada di tepi bilik kesatuan pelajar. \u2461 Pertandingan akan diadakan di kompleks sukan kalau hujan. \u2462 Peyerta perlu sampai sebelum 9 am.",q,j,"64. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",k,n),A.m("\u2461 \uc74c\uc2dd\uc744 \uba39\uc740 \ud6c4\uc5d0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0627\u0644\u0645\u0634\u0631\u0648\u0628 \u0627\u0644\u062a\u0642\u0644\u064a\u062f\u064a \u0627\u0644\u0643\u0648\u0631\u064a [\uc2dd\ud61c]. \u0627\u0644 [\uc2dd\ud61c] \u062a\u0633\u0627\u0639\u062f \u0639\u0644\u0649 \u0627\u0644\u0647\u0636\u0645. \u0644\u0630\u0644\u0643 \u0646\u0634\u0631\u0628 \u0627\u0644 [\uc2dd\ud61c] \u0628\u0639\u062f \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0641\u064a \u062a\u062c\u0645\u0639 \u0623\u0648 \u062d\u0641\u0644\u0629","\u5bf9\u8bdd\u4ecb\u7ecd\u7684\u662f\u97e9\u56fd\u4f20\u7edf\u996e\u54c1 [\uc2dd\ud61c]\u3002 [\uc2dd\ud61c] \u5e2e\u52a9\u6d88\u5316\u3002\u56e0\u6b64\uff0c\u4eba\u4eec\u901a\u5e38\u5728\u805a\u4f1a\u6216\u5bb4\u4f1a\u4e0a\u5403\u5b8c\u996d\u540e\u559d [\uc2dd\ud61c]\u3002","\u5c0d\u8a71\u4ecb\u7d39\u7684\u662f\u97d3\u570b\u50b3\u7d71\u98f2\u54c1 [\uc2dd\ud61c]\u3002 [\uc2dd\ud61c] \u5e6b\u52a9\u6d88\u5316\u3002\u56e0\u6b64\uff0c\u4eba\u5011\u901a\u5e38\u5728\u805a\u6703\u6216\u5bb4\u6703\u4e0a\u5403\u5b8c\u98ef\u5f8c\u559d [\uc2dd\ud61c]\u3002","This text is about the Korean traditional beverage, [\uc2dd\ud61c]. [\uc2dd\ud61c] improves digestion. So, the Korean usually drink [\uc2dd\ud61c] after meals at gatherings or parties."," \u2460 \uc6b4\ub3d9\uc744 \ud55c \ud6c4\uc5d0\n \u2461 \uc74c\uc2dd\uc744 \uba39\uc740 \ud6c4\uc5d0\n \u2462 \ubaa8\uc784\uc5d0 \uac00\uae30 \uc804\uc5d0\n \u2463 \uc74c\ub8cc\uc218\ub97c \ub9c8\uc2dc\uae30 \uc804\uc5d0",n,7,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u97d3\u56fd\u306e\u4f1d\u7d71\u7684\u306a\u98f2\u307f\u7269[\uc2dd\ud61c(\u30b7\u30c3\u30b1/\u7518\u9152)]\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002[\uc2dd\ud61c]\u306f\u6d88\u5316\u3092\u52a9\u3051\u307e\u3059\u3002\u3057\u305f\u304c\u3063\u3066\u4e00\u822c\u7684\u306b\u96c6\u307e\u308a\u3084\u5bb4\u4f1a\u3067\u98df\u4e8b\u3092\u3057\u305f\u5f8c\u306b[\uc2dd\ud61c]\u3092\u98f2\u307f\u307e\u3059\u3002","\uc774 \uae00\uc740 \ud55c\uad6d\uc758 \uc804\ud1b5 \uc74c\ub8cc \uc2dd\ud61c\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc2dd\ud61c\ub294 \uc18c\ud654\ub97c \ub3c4\uc640\uc90d\ub2c8\ub2e4. \uadf8\ub798\uc11c \ubcf4\ud1b5 \ubaa8\uc784\uc774\ub098 \uc794\uce58\uc5d0\uc11c \uc74c\uc2dd\uc744 \uba39\uc740 \ud6c4\uc5d0 \uc2dd\ud61c\ub97c \ub9c8\uc2ed\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang minuman tradisional Korea,  [\uc2dd\ud61c].  [\uc2dd\ud61c] dapat meningkatkan pencernaan. Jadi, biasaya, orang Korea meminum  [\uc2dd\ud61c] selepas menghabiskan makanan di jamuan.",q,n,"65. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",i,h),A.m("\u2462 \uc2dd\ud61c\ub294 \ucc28\uac11\uac8c \ub9c8\uc2dc\uba74 \ub354 \ub9db\uc788\uc2b5\ub2c8\ub2e4.","1- \u062a\u062d\u0636\u064a\u0631 \u0627\u0644 [\uc2dd\ud61c] \u064a\u0633\u062a\u063a\u0631\u0642 \u0648\u0642\u062a\u0627 \u0637\u0648\u064a\u0644\u0627. 2- \u064a\u062d\u0628 \u0627\u0644\u0646\u0627\u0633 \u0627\u0644 [\uc2dd\ud61c] \u0644\u0623\u0646\u0647\u0627 \u062d\u0644\u0648\u0629. 4- \u0639\u0646\u062f \u0627\u0644\u0630\u0647\u0627\u0628 \u0625\u0644\u0649 \u062a\u062c\u0645\u0639 \u0623\u0648 \u062d\u0641\u0644\u0629 \u0646\u0634\u0631\u0628 \u0627\u0644 [\uc2dd\ud61c]","\u2460 [\uc2dd\ud61c] \u9700\u8981\u5f88\u957f\u65f6\u95f4\u624d\u80fd\u5236\u4f5c\u3002 \u2461 [\uc2dd\ud61c] \u5f88\u751c\uff0c\u4eba\u4eec\u559c\u6b22\u5b83\u3002 \u2463 \u53bb\u5f00\u4f1a\u6216\u5bb4\u8bf7\u65f6\uff0c\u559d[\uc2dd\ud61c]\u3002","\u2460 [\uc2dd\ud61c] \u9700\u8981\u5f88\u9577\u6642\u9593\u624d\u80fd\u88fd\u4f5c\u3002 \u2461 [\uc2dd\ud61c] \u5f88\u751c\uff0c\u4eba\u5011\u559c\u6b61\u5b83\u3002 \u2463 \u53bb\u958b\u6703\u6216\u5bb4\u8acb\u6642\uff0c\u559d[\uc2dd\ud61c]\u3002","\u2460 It takes long to make [\uc2dd\ud61c]. \u2461 People like [\uc2dd\ud61c] because it tastes sweet. \u2463 People drink [\uc2dd\ud61c] at gatherings or parties."," \u2460 \uc2dd\ud61c\ub294 \ube68\ub9ac \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n \u2461 \uc2dd\ud61c\ub294 \ub2ec\uc544\uc11c \uc0ac\ub78c\ub4e4\uc774 \uc2eb\uc5b4\ud569\ub2c8\ub2e4. \n \u2462 \uc2dd\ud61c\ub294 \ucc28\uac11\uac8c \ub9c8\uc2dc\uba74 \ub354 \ub9db\uc788\uc2b5\ub2c8\ub2e4. \n \u2463 \ubaa8\uc784\uc774\ub098 \uc794\uce58\uc5d0 \uac00\uba74 \uc2dd\ud61c\ub97c \ub9cc\ub4ed\ub2c8\ub2e4. ",n,8,"\u2460[\uc2dd\ud61c(\u30b7\u30c3\u30b1/\u7518\u9152)]\u306f\u4f5c\u308b\u306e\u306b\u6642\u9593\u304c\u304b\u304b\u308a\u307e\u3059\u3002\u2461[\uc2dd\ud61c]\u306f\u7518\u3044\u306e\u3067\u591a\u304f\u306e\u4eba\u304c\u597d\u304d\u3067\u3059\u3002\u2463\u96c6\u307e\u308a\u3084\u5bb4\u4f1a\u306b\u884c\u3051\u3070[\uc2dd\ud61c]\u3092\u98f2\u307f\u307e\u3059\u3002","\u2460 \uc2dd\ud61c\ub294 \ub9cc\ub4dc\ub294 \ub370 \uc2dc\uac04\uc774 \uc624\ub798 \uac78\ub9bd\ub2c8\ub2e4. \u2461 \uc2dd\ud61c\ub294 \ub2ec\uc544\uc11c \uc0ac\ub78c\ub4e4\uc774 \uc88b\uc544\ud569\ub2c8\ub2e4. \u2462 \uc2dd\ud61c\ub294 \ucc28\uac11\uac8c \ub9c8\uc2dc\uba74 \ub354 \ub9db\uc788\uc2b5\ub2c8\ub2e4. \u2463 \ubaa8\uc784\uc774\ub098 \uc794\uce58\uc5d0 \uac00\uba74 \uc2dd\ud61c\ub97c \ub9c8\uc2ed\ub2c8\ub2e4. ","\u2460 [\uc2dd\ud61c]dibuatkan dalam masa yang panjang. \u2461 Orang suka meminum [\uc2dd\ud61c] kerana berasa manis. \u2463 Apabila pergi ke jamuan,biasanya orang meminum [\uc2dd\ud61c].",q,n,"66. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",i,h),A.m("\u2460 \ub098\uc9c0","\u0644\u0627 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u062e\u0637\u0631 \u0628\u0628\u0627\u0644\u0646\u0627 \u0623\u0641\u0643\u0627\u0631 \u062c\u064a\u062f\u0629 \u0639\u0646\u062f \u062d\u0644 \u0627\u0644\u0623\u0633\u0626\u0644\u0629 \u062c\u0627\u0644\u0633\u064a\u0646. [\uc0dd\uac01\uc774 \ub098\ub2e4] \u062a\u0639\u0646\u064a \u062a\u0630\u0643\u064f\u0631 \u0634\u064a\u0621 \u0623\u0648 \u0625\u062d\u0633\u0627\u0633 \u0623\u0648 \u0631\u0623\u064a","\u5982\u679c\u60f3\u89e3\u51b3\u95ee\u9898\u65f6\uff0c\u5149\u4e00\u76f4\u5750\u7740\u662f\u60f3\u4e0d\u5230\u597d\u70b9\u5b50\u7684\u3002[\uc0dd\uac01\uc774 \ub098\ub2e4]\u662f\u8868\u8fbe\u610f\u89c1\u6216\u8bb0\u5fc6\u7a81\u7136\u6d6e\u73b0\u7684\u610f\u601d\u3002","\u4e00\u76f4\u5750\u8457\u89e3\u6c7a\u554f\u984c\u4e26\u4e0d\u662f\u4e00\u500b\u597d\u4e3b\u610f\u3002 [\uc0dd\uac01\uc774 \ub098\ub2e4]\u662f\u8aaa\u60f3\u8d77\u4f86\u67d0\u500b\u56de\u61b6\u6216\u611f\u89ba\u3002","If you keep sitting when you solve problems, you can't come up with any good idea. [\uc0dd\uac01\uc774 \ub098\ub2e4] means that an opinion, a feeling, or a memory comes to mind."," \u2460 \ub098\uc9c0\n \u2461 \ub9ce\uc9c0\n \u2462 \uc5c6\uc5b4\uc9c0\uc9c0\n \u2463 \ub2ec\ub77c\uc9c0\uc9c0",n,9,"\u554f\u984c\u3092\u89e3\u304f\u6642\u3001\u305a\u3063\u3068\u5ea7\u3063\u3066\u3044\u308b\u3068\u826f\u3044\u30a2\u30a4\u30c7\u30a2\u304c\u6d6e\u304b\u3073\u307e\u305b\u3093\u3002 [\uc0dd\uac01\uc774 \ub098\ub2e4]\u306f\u610f\u898b\u3084\u5370\u8c61\u3001\u8a18\u61b6\u304c\u601d\u3044\u6d6e\u304b\u3076\u3068\u3044\u3046\u610f\u5473\u304c\u3042\u308a\u307e\u3059\u3002","\ubb38\uc81c\ub97c \ud480 \ub54c \uacc4\uc18d \uc549\uc544 \uc788\uc73c\uba74 \uc88b\uc740 \uc0dd\uac01\uc774 \ub098\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. [\uc0dd\uac01\uc774 \ub098\ub2e4]\ub294 \uc758\uacac\uc774\ub098 \ub290\ub08c, \uae30\uc5b5\uc774 \ub5a0\uc624\ub978\ub2e4\ub294 \uc758\ubbf8\uac00 \uc788\uc2b5\ub2c8\ub2e4. ","Kalau selalu duduk tidak dapat berfikir idea yang bagus semasa membuat soalan.  [\uc0dd\uac01\uc774 \ub098\ub2e4] bermaksud mempunyai fikiran tentang sesuatu pendapat, perasaan, atau ingatan. ",q,n,"67. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",g,f),A.m("\u2462 \ub098\uac00\uc9c0 \uc54a\uc544\ub3c4 \ub429\ub2c8\ub2e4.","\u0627\u0644\u0645\u0634\u064a \u062c\u064a\u062f \u0641\u064a \u062d\u0627\u0644 \u0644\u0645 \u062a\u062e\u0637\u0631 \u0628\u0628\u0627\u0644\u0646\u0627 \u0623\u0641\u0643\u0627\u0631 \u062c\u064a\u062f\u0629.\u0644\u0643\u0646 \u0644\u0627 \u064a\u062c\u0628 \u0623\u0646 \u0646\u062e\u0631\u062c \u0645\u0646 \u0627\u0644\u0628\u064a\u062a","\u6ca1\u6709\u597d\u70b9\u5b50\u7684\u65f6\u5019\u8d77\u8eab\u8d70\u8d70\u4e5f\u4e0d\u9519\u3002\u4f46\u4e5f\u4e0d\u4e00\u5b9a\u8981\u51fa\u95e8\u3002","\u6c92\u6709\u597d\u5ff5\u982d\u7684\u6642\u5019\u8d77\u8eab\u8d70\u8d70\u4e5f\u4e0d\u932f\u3002\u4f46\u4e5f\u4e0d\u4e00\u5b9a\u8981\u51fa\u9580\u3002","When you can't come up with any good idea, it is helpful to stand up and take a walk. But, it isn't necessary to go outside."," \u2460 \ub098\uac00\ub824\uace0 \ud569\ub2c8\ub2e4\n \u2461 \ub098\uac08 \uc218 \uc788\uc2b5\ub2c8\ub2e4\n \u2462 \ub098\uac00\uc9c0 \uc54a\uc544\ub3c4 \ub429\ub2c8\ub2e4\n \u2463 \ub098\uac00\uc9c0 \uc54a\uae30\ub85c \ud569\ub2c8\ub2e4 ",n,10,"\u826f\u3044\u30a2\u30a4\u30c7\u30a2\u304c\u6d6e\u304b\u3070\u306a\u3044\u6642\u306f\u3001\u7acb\u3061\u4e0a\u304c\u3063\u3066\u6b69\u304f\u306e\u304c\u826f\u3044\u3067\u3059\u3002\u3057\u304b\u3057\u3001\u5fc5\u305a\u5916\u306b\u51fa\u306a\u304f\u3066\u3082\u826f\u3044\u3067\u3059\u3002","\uc88b\uc740 \uc0dd\uac01\uc774 \ub098\uc9c0 \uc54a\uc744 \ub54c \uc77c\uc5b4\ub098\uc11c \uac77\ub294 \uac83\uc774 \uc88b\uc2b5\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \uaf2d \ubc16\uc5d0 \ub098\uac00\uc9c0 \uc54a\uc544\ub3c4 \ub429\ub2c8\ub2e4. ","Bangun dan berjalan-jalan bagus semasa tidak mempunyai fikiran yang baik semasa membuat soalan tetapi tidak mestinya perlu pergi ke luar untuk berjalan-jalan.",q,n,"68. \u3261\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",g,f),A.m("\u2463 \ud560\uba38\ub2c8\uc758 \ub178\ub798\ub97c \ub4e4\uc740","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0627\u0644\u062c\u062f\u0629 \u0627\u0644\u062a\u064a \u062a\u062d\u0628 \u0627\u0644\u0623\u063a\u0627\u0646\u064a. \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0644\u0645 \u064a\u0639\u0631\u0641 \u0623\u0646 \u0627\u0644\u062c\u062f\u0629 \u062a\u062d\u0628 \u0627\u0644\u0623\u063a\u0627\u0646\u064a.\u0644\u0623\u0646\u0647 \u0644\u0645 \u064a\u0633\u0645\u0639 \u063a\u0646\u0627\u0621 \u0627\u0644\u062c\u062f\u0629 \u0645\u0646 \u0642\u0628\u0644","\u5bf9\u8bdd\u4ecb\u7ecd\u7684\u662f\u4e00\u4f4d\u559c\u6b22\u5531\u6b4c\u7684\u5976\u5976\u3002\u8fd9\u4e2a\u7537\u58eb\u4e0d\u77e5\u9053\u4ed6\u7684\u5976\u5976\u559c\u6b22\u5531\u6b4c\u3002\u56e0\u4e3a\u4ed6\u4ece\u6765\u6ca1\u6709\u542c\u8fc7\u5976\u5976\u5531\u6b4c\u3002","\u5c0d\u8a71\u4ecb\u7d39\u7684\u662f\u4e00\u4f4d\u559c\u6b61\u5531\u6b4c\u7684\u5976\u5976\u3002\u9019\u500b\u7537\u58eb\u4e0d\u77e5\u9053\u4ed6\u7684\u5976\u5976\u559c\u6b61\u5531\u6b4c\u3002\u56e0\u70ba\u4ed6\u5f9e\u4f86\u6c92\u6709\u807d\u904e\u6211\u7956\u6bcd\u5531\u6b4c\u3002","This text is about the story the grandmother who likes singing songs. This person didn\u2019t know that grandmother likes singing songs. That's because he hasn't heard her song before."," \u2460 \ud560\uba38\ub2c8\uc640 \uacf5\uc5f0\uc744 \ud55c\n \u2461 \ud560\uba38\ub2c8\uc640 \uacf5\uc5f0\uc744 \ubcf8\n \u2462 \ud560\uba38\ub2c8\uc640 \ub178\ub798\ub97c \ubc30\uc6b4\n \u2463 \ud560\uba38\ub2c8\uc758 \ub178\ub798\ub97c \ub4e4\uc740",n,11,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u6b4c\u304c\u597d\u304d\u306a\u7956\u6bcd\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u4eba\u306f\u7956\u6bcd\u304c\u6b4c\u304c\u597d\u304d\u306a\u3053\u3068\u3092\u77e5\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u3002\u7956\u6bcd\u306e\u6b4c\u3092\u805e\u3044\u305f\u3053\u3068\u304c\u306a\u3044\u304b\u3089\u3067\u3059\u3002","\uc774 \uae00\uc740 \ub178\ub798\ub97c \uc88b\uc544\ud558\ub294 \ud560\uba38\ub2c8\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \ud560\uba38\ub2c8\uaed8\uc11c \ub178\ub798\ub97c \uc88b\uc544\ud558\ub294 \uac83\uc744 \ubab0\ub790\uc2b5\ub2c8\ub2e4. \ud560\uba38\ub2c8\uc758 \ub178\ub798\ub97c \ub4e4\uc740 \uc801\uc774 \uc5c6\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang nenek yang suka berlagu. Orang tersebut  tidak tahu neneknya suka berlagu kerana dia tidak pernah menampak neneknya berlagu.",q,n,"69. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",e,d),A.m("\u2460 \ud560\uba38\ub2c8\ub294 \ub178\ub798 \ubd80\ub974\uae30\ub97c \uc88b\uc544\ud558\uc2ed\ub2c8\ub2e4.","1- \u0623\u0633\u0631\u0629 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0644\u0645 \u062a\u0633\u0645\u0639 \u063a\u0646\u0627\u0621 \u0627\u0644\u062c\u062f\u0629 \u0645\u0646 \u0642\u0628\u0644. 3- \u062f\u0639\u062a\u0646\u0627 \u0627\u0644\u062c\u062f\u0629 \u0623\u0648\u0644 \u0645\u0631\u0629 \u0644\u062d\u0636\u0648\u0631 \u0639\u0631\u0636. 4- \u0633\u062a\u0630\u0647\u0628 \u0623\u0633\u0631\u0629 \u0647\u0630\u0627 \u0627\u0644\u0631\u062c\u0644 \u0644\u0645\u0634\u0627\u0647\u062f\u0629 \u0627\u0644\u0639\u0631\u0636",c,c,"\u2461 This person's family haven't heard grandmother's song before. \u2462 Grandmother invited all the family members. \u2463 This person's family will watch grandmother's performance."," \u2460 \ud560\uba38\ub2c8\ub294 \ub178\ub798 \ubd80\ub974\uae30\ub97c \uc88b\uc544\ud558\uc2ed\ub2c8\ub2e4.\n \u2461 \uc6b0\ub9ac \uac00\uc871\uc740 \ud568\uaed8 \ub178\ub798 \uc5f0\uc2b5\uc744 \ud588\uc2b5\ub2c8\ub2e4. \n \u2462 \ud560\uba38\ub2c8\ub294 \uac00\ub054 \uc6b0\ub9ac\ub97c \uacf5\uc5f0\uc5d0 \ucd08\ub300\ud558\uc2ed\ub2c8\ub2e4.\n \u2463 \uc6b0\ub9ac \uac00\uc871\uc740 \ud560\uba38\ub2c8\uc758 \uacf5\uc5f0\uc744 \ubcf4\ub7ec \uac14\uc2b5\ub2c8\ub2e4. ",n,12,"\u2461\u3053\u306e\u4eba\u306e\u5bb6\u65cf\u306f\u7956\u6bcd\u306e\u6b4c\u3092\u805e\u3044\u305f\u3053\u3068\u304c\u3042\u308a\u307e\u305b\u3093\u3002\u2462\u7956\u6bcd\u306f\u521d\u3081\u3066\u5bb6\u65cf\u3092\u516c\u6f14\u306b\u62db\u5f85\u3057\u307e\u3057\u305f\u3002\u2463\u3053\u306e\u4eba\u306e\u5bb6\u65cf\u306f\u7956\u6bcd\u306e\u516c\u6f14\u3092\u898b\u306b\u884c\u304f\u4e88\u5b9a\u3067\u3059\u3002","\u2460 \ud560\uba38\ub2c8\ub294 \ub178\ub798 \ubd80\ub974\uae30\ub97c \uc88b\uc544\ud558\uc2ed\ub2c8\ub2e4. \u2461 \uc774 \uc0ac\ub78c \uac00\uc871\uc740 \ud560\uba38\ub2c8\uc758 \ub178\ub798\ub97c \ub4e4\uc740 \uc801\uc774 \uc5c6\uc2b5\ub2c8\ub2e4. \u2462 \ud560\uba38\ub2c8\ub294 \ucc98\uc74c \uc6b0\ub9ac\ub97c \uacf5\uc5f0\uc5d0 \ucd08\ub300\ud558\uc168\uc2b5\ub2c8\ub2e4. \u2463 \uc774 \uc0ac\ub78c \uac00\uc871\uc740 \ud560\uba38\ub2c8\uc758 \uacf5\uc5f0\uc744 \ubcf4\ub7ec \uac08 \uac81\ub2c8\ub2e4. ","\u2461 Keluarga tersebut tidak pernah nampak nenek berlagu. \u2462 Nenek menjemput kami ke persembahannya. \u2463 Keluarga tersebut akan pergi ke persembahan nenek.",q,n,"70. \uc774 \uae00\uc758 \ub0b4\uc6a9\uc73c\ub85c \uc54c \uc218 \uc788\ub294 \uac83\uc740 \ubb34\uc5c7\uc785\ub2c8\uae4c? (3\uc810)",e,d)],t.p)})
